// import { Navbar } from 'bootstrap5';
import React from 'react';
import { Outlet } from 'react-router-dom';

function RootLayout(props) {
    return (
        <>
            <Navbar />
            <main>
                <Outlet />
            </main>
        </>
    );
}

export default RootLayout;
